import React, { Component } from 'react';


class Card extends Component{
    render(){
        return(
            <div className="cardHolder">
                <span className="cards">
                    <img src={"./public/img/bvdub.jpg"}></img>
                </span>


            </div>

        );
    }
}

export default Card;
